<?php
$string = "";

$stringArrays = [];
$strings = [];
$split = str_split($string);
$count = count($split);
$value = [];
for ($i = 0; $i <= $count - 14; $i++) {
    $stringArrays[] = [
        $split[$i],
        $split[$i + 1],
        $split[$i + 2],
        $split[$i + 3],
        $split[$i + 4],
        $split[$i + 5],
        $split[$i + 6],
        $split[$i + 7],
        $split[$i + 8],
        $split[$i + 9],
        $split[$i + 10],
        $split[$i + 11],
        $split[$i + 12],
        $split[$i + 13],
    ];
    if (empty($stringArrays[count($stringArrays) - 1][3])) {
        array_pop($stringArrays);
    }
}

foreach ($stringArrays as $index => $stringArray) {
    if (count(array_unique($stringArray)) === 14) {
        $value = $index + 14;
        break;
    }
}
print_r($value);